import React from 'react';
import Logo from "./Logo";
import  menu from "../../../image/menu.svg";
function MobileHeader(props) {
    const style = {
        margin: "0 7% 0",
        paddingTop: "3%"
    }
    return (
        <div className="row spbween header-margin" style={style}>
            <Logo/>
            <img src={menu}/>
        </div>
    );
}

export default MobileHeader;
